[xml]$xaml=@"
<Window 
        xmlns="http://schemas.microsoft.com/winfx/2006/xaml/presentation"
        Title="M365 Guest Account Inviter" Height="450" Width="725" WindowStartupLocation="CenterScreen" Name="AppWindow">
        <Window.TaskbarItemInfo>
            <TaskbarItemInfo/>
        </Window.TaskbarItemInfo>
    <Grid>
        <Grid.RowDefinitions>
            <RowDefinition Height="60*"></RowDefinition>
            <RowDefinition Height="320*"></RowDefinition>
            <RowDefinition Height="60*"></RowDefinition>
        </Grid.RowDefinitions>
        <Label Name="lblAppName" Content="M365 Guest User Creator" HorizontalAlignment="Left" Margin="10,0,0,0" VerticalAlignment="Center" Height="40" Width="550" FontSize="18"/>
        <Label Name="lblTentant" Content="tentant.onmicrosoft.com" HorizontalAlignment="Left" Margin="10,35,0,0" VerticalAlignment="Center" Width="550" Height="26"/>
        <Label Content="Vorname" HorizontalAlignment="Left" Margin="10,10,0,0" Grid.Row="1" VerticalAlignment="Top" Height="26" Width="57"/>
        <Label Content="Name" HorizontalAlignment="Left" Margin="10,30,0,0" Grid.Row="1" VerticalAlignment="Top" Height="26" Width="42"/>
        <Label Content="Firma" HorizontalAlignment="Left" Margin="10,50,0,0" Grid.Row="1" VerticalAlignment="Top" Height="26" Width="39"/>
        <Label Content="E-Mail Adresse" HorizontalAlignment="Left" Margin="10,70,0,0" Grid.Row="1" VerticalAlignment="Top" Height="26" Width="89"/>
        <TextBox Name="txtVorname" HorizontalAlignment="Left" Margin="151,14,0,0" Grid.Row="1" TextWrapping="Wrap" Text="VN" VerticalAlignment="Top" Width="543" Height="18"/>
        <TextBox Name="txtName" HorizontalAlignment="Left" Margin="151,34,0,0" Grid.Row="1" TextWrapping="Wrap" Text="NN" VerticalAlignment="Top" Width="543" Height="18"/>
        <TextBox Name="txtFirma" HorizontalAlignment="Left" Margin="151,54,0,0" Grid.Row="1" TextWrapping="Wrap" Text="Company" VerticalAlignment="Top" Width="543" Height="18"/>
        <TextBox Name="txtEMail" HorizontalAlignment="Left" Margin="151,74,0,0" Grid.Row="1" TextWrapping="Wrap" Text="egos.teilnehmer@gmail.com" VerticalAlignment="Top" Width="543" Height="18"/>
        <TextBox Name="tbResult" HorizontalAlignment="Left" Margin="14,101,0,0" Grid.Row="1" TextWrapping="Wrap" Text="-" VerticalAlignment="Top" Height="200" Grid.ColumnSpan="2" Width="680" FontFamily="Cascadia Mono" FontSize="10"/>      
        <Button Name="btnStart" Content="Guest anlegen" HorizontalAlignment="Left" Margin="570,10,0,0" Grid.Row="2" VerticalAlignment="Center" Height="20" Width="124"/>
        <Label Name="lblStatus" Content="©2023 EGOS! The Education Company, All Rights Reserved" HorizontalAlignment="Left" Margin="10,0,0,0" Grid.Row="2" VerticalAlignment="Top" Height="26" Width="700"/>
    </Grid>
</Window>
"@ 

$IconB64 = @"

"@

function SetAppIcon
{
Param([string]$Base64)    
$bitmap = New-Object System.Windows.Media.Imaging.BitmapImage
$bitmap.BeginInit()
$bitmap.StreamSource = [System.IO.MemoryStream][System.Convert]::FromBase64String($Base64)
$bitmap.EndInit()
$bitmap.Freeze()
$AppWindow.Icon=$bitmap
$AppWindow.TaskbarItemInfo.Overlay=$bitmap
}

function New-Guest
{
param(
    [string]$FirstName,
    [string]$LastName,
    [string]$EMail,
    [string]$Company
)
$OldCursor=$XAMLGui.Cursor
$XAMLGui.Cursor=[System.Windows.Input.Cursors]::Wait
$lblStatus.Content="Creating guest $Email"
$messageInfo = New-Object Microsoft.Open.MSGraph.Model.InvitedUserMessageInfo
$messageInfo.customizedMessageBody = $Config.CustomMessage

$User=New-AzureADMSInvitation -InvitedUserDisplayName ($Firstname+" "+$Lastname+" - "+$Company) `
                              -InvitedUserEmailAddress $EMail `
                              -InviteRedirectURL $Config.ReturnURL `
                              -SendInvitationMessage $Config.SendInvite `
                              -InvitedUserMessageInfo $messageInfo

$Id=$User.InvitedUser.Id

Set-AzureADUser -ObjectId $Id -GivenName $FirstName -Surname $LastName -UsageLocation $Config.UsageLocation
$lblStatus.Content=("{0}: Created guest '{2}' with Id '{1}'" -f (Get-Date -Format "dd.MM.yy HH:mm:ss"),$id, $EMail)
$User | Format-List *
$tbResult.Text=($User | Format-List InvitedUser*,Status | Out-String).Trim()
$XAMLGui.Cursor=$OldCursor
return $User
}

$Config=@{
    TenantName="egoscloud.onmicrosoft.com"
    ReturnURL="https://www.egos.co.at"
    UsageLocation="AT"
    SendInvite=$false
    CustomMessage="Ihre Einladung zur Mitarbeit im EGOS! Netzwerk"
}

[void][System.Reflection.Assembly]::LoadWithPartialName('presentationcore')
[void][System.Reflection.Assembly]::LoadWithPartialName('presentationframework')
$XAMLGui=[Windows.Markup.XamlReader]::Load( (New-Object System.Xml.XmlNodeReader $XAML) )

$XAML.SelectNodes("//*[@*[contains(translate(name(.),'n','N'),'Name')]]") | % {
    Set-Variable -Name ($_.Name) -Value $XAMLGui.FindName($_.Name) -Scope Global 
}

$lblTentant.Content=$Config.TenantName
$btnStart.Add_Click({
    New-Guest -Firstname $txtVorname.Text -Lastname $txtName.Text -EMail $txtEMail.Text -Company $txtFirma.Text
    }
)

$bIsAutenticated=$false
$bToQuit=$false
do
{
    try
    {
        $TentantInfo=Get-AzureADTenantDetail
        $bIsAutenticated=$true
        Write-Host "Authenticated successfully"
    }
    catch [Microsoft.Open.Azure.AD.CommonLibrary.AadNeedAuthenticationException]
    {
        try {
            $Connection=Connect-AzureAD     
        }
        catch {
            $ErrMgr=$Error[0].Exception.Message
            $Result=[System.Windows.MessageBox]::Show("Die Cloud-Anmeldung war nicht erfolgreich!`n`n$ErrMgr`n`nErneut versuchen?",$AppWindow.Title,[System.Windows.MessageBoxButton]::YesNo)
            if ($Result -eq 7)
            {
                $bToQuit=$true
            }
        }
        
    }
    
} until($bIsAutenticated -eq $true -or $bToQuit -eq $true)

if($bToQuit -eq $false)
{
    SetAppIcon($IconB64)
    $lblAppName.Content=$lblAppName.Content+" ["+$TentantInfo.DisplayName+"]"
    $AppWindow.Title=$AppWindow.Title+" ["+$TentantInfo.DisplayName+"]"
    $lblTentant.Content=$Connection.Account.id+" | "+$Connection.TenantDomain
    $txtVorname.Focus()
    $XAMLGui.ShowDialog()
}
